      | 35912 -> { ItemTypeData.id= 35912; name= "Standup Cynosural Field Generator I"; published= true; description= "The Standup Cynosural Field Generator is a service module that creates a perpetual cynosural field beacon while active. This cynosural beacon is accessible as a jump destination for all capsuleers whom the structure owners have authorized using the Upwell Access Control List network. This module cannot operate in the same star system as an active Cynosural System Jammer.    This service module may only be onlined in a system that contains an Infrastructure Hub with the <a href=showinfo:2008>Cynosural Navigation</a> upgrade active.  This service module is automatically included built-in to every Upwell <a href=showinfo:35840>Pharolux Cyno Beacon</a>, and cannot be removed from that structure.    Standup is a proprietary system that uses a Structure Autonomous Nanoassembly Device (Upwell) containing integrated template software, a nanoassembler array and sufficient nanomass to enable the construction of a variety of service modules, structure modules and structure rigs when inserted into the appropriate slots on a structure built with Upwell technology."; marketGroupId= None; groupId= 1324; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 1000000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 500.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 2791; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 2334; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 1074; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 50; value= 10000.000000 }; { DogmaAttributeValueData.attributeId = 2804; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 2110; value= 1080.000000 }; { DogmaAttributeValueData.attributeId = 1302; value= 35840.000000 }; { DogmaAttributeValueData.attr