      | 48425 -> { ItemTypeData.id= 48425; name= "Gravid Heavy Energy Nosferatu Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter energy charge leeching devices. As such this mutaplasmid could be used to mutate the performance characteristics of most energy nosferatu modules in the correct size class.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool appears to be mature and reproducing at a healthy rate. The mutational benefits and risks of using this mutaplasmid are within relatively balanced bounds."; marketGroupId= Some(2455); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 48522 -> { ItemTypeData.id= 48522; name= "Vargur Chainbreaker Khumaak SKIN (Permanent)"; published= true; description= "An instrument of liberation, most strikingly known as a weapon to crush the heads of slavers and a tool to break the chains of slaves, the Khumaak is celebrated as the symbol of the Great Rebellion and Minmatar freedom from Amarr domination.    The Khumaak (literally  Hand of Maak ) is a replica of an ancient Amarrian relic used over 400 years ago by the Minmatar slave Drupar Maak to kill his master, Arkon Ardishapur, on Arzad II. The legend says that Maak was inspired in his struggle for freedom by a vision of Holder Arzad, an Amarr noble who had treated his Starkmanir subjects with dignity. Arzad is said to have told Maak:  The fire in our hearts burns for salvation, redemption, and grace. May the Word of God grant you the courage to save yourself and your people.     Maak's killing of the Ardishapur heir sparked a revolt on Arzad II, also known as Starkman Prime. The slaying of Arkon Ardishapur was met with the brutal crushing of the revolt and almost total annihilation of the Starkmanir Tribe by orbital bombardment. The Starkmanir Rebellion preceded the Great Rebellion by over 250 years but its impact is held by historians to have been a major factor in the development of the underground slave movements that would ultimately fight for their freedom in 20 BYC (AD 23216)."; marketGroupId= Some(2027); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
